import axios from 'axios';
import projectSettings from '../../constants/projectSettings';
export var searchAddress = function searchAddress(address) {
  return axios.get("https://maps.googleapis.com/maps/api/geocode/json?address=".concat(address.split(" ").join("+"), "&key=").concat(projectSettings.googleApiKey), {
    headers: {
      "Accept-Encoding": "gzip",
      "User-Agent": "my program (gzip)"
    }
  });
};
